import React from 'react';
import Instant_buy from "./Instant_buy";
import Instant_sell from "./Instant_sell";
import { Link } from 'react-router-dom';
import {BrowserRouter as Router, Switch } from 'react-router-dom'


const Navbuy_sell = () => {
    const disappear = () => {
        console.log('dissapear');
        let instant_buy = document.getElementById('instant_buy')
        console.log(instant_buy);
    }
    return (
        <Router>
            <div>    
                <div  className='getbuttondiv2'>
                <Link to='/instant_buy'><button className='getbutton'>Buy</button></Link>
               <spam className='getbutton3'> <Link to='/instant_sell'><button className='getbutton2' onClick ={disappear} >Sell</button></Link></spam>


               
            </div>
            

          
                    <Instant_buy id ='instant_buy'/>
            
            <Switch>
 
            
               

                <Router exact path = "/instant_sell">
                    <Instant_sell/>
                </Router>
               
            </Switch>
           
            </div>
            
        </Router>
    )
}

export default Navbuy_sell
